message:
As instituições políticas, ideológicas e religiosas dos países ocidentais não só ficaram a margem da luta do Nacional Socialismo de Berlim contra o comunismo de Moscou, como também indiretamente se fortaleciam mutuamente porque ao desaparecer o bolchevismo automáticamente iría desaparecer o principal inimigo dessas instituições.

Don Salvador Borrego, em a Derrota Mundial

@ProtocolosSion 📖
